EventAction_LuaScript.ScriptText:
math.randomseed(os.time())

local airGroups = {
	{name='Flight 18', guid='adc517c9-da68-4a94-a37c-e21f31c90169'} , 
	{name='Flight 19', guid='938ce65f-094f-44f5-bb86-ee41f4022ae3'} , 
	{name='Flight 20', guid='d04eb74d-2332-4093-9029-fa731170cfe0'} , 
	{name='Flight 21', guid='41fb1c47-efc0-4628-9ee9-8dc39d9e1dfc'}
}

local centrePoint = ScenEdit_GetReferencePoint({side='OPFOR',name='Centrepoint'})

for k,v in ipairs (airGroups) do 
	local newPos = CircularRandomPosition(centrePoint.latitude,centrePoint.longitude,75)
	ScenEdit_SetUnit({
		guid=v.guid,
		latitude=newPos.latitude,
		longitude=newPos.longitude
	})
end

local airDefences = {
	{name='AAA Bty (37mm T65 Twin x 4)', guid='5216f419-a72b-4b1b-8a21-68b22975cb25', range=0.5} , 
	{name='SAM Plt (SA-9b Gaskin [9K31 Strela-1])', guid='c2b5adf4-c3ea-4ba1-9ada-455bfc8a4c5e', range = 0.5} , 
	{name='AAA Bty (57mm M1950 x 4 + Fire Can FC)', guid='6c6aaba2-1003-4d19-a36d-e8176b725e4d', range = 4} , 
	{name='SAM  (SA-3b Goa)', guid='6ced4e83-bbbc-4fd1-9078-9f18f686809a', range= 10}
}

for k,v in ipairs (airDefences) do 
	local newPos = CircularRandomPosition(centrePoint.latitude,centrePoint.longitude,v.range/2)
	ScenEdit_SetUnit({
		guid=v.guid,
		latitude=newPos.latitude,
		longitude=newPos.longitude
	})
end

RandomiseSideUnitProficiency('OPFOR')

local theDestroyedUnit = ScenEdit_UnitX()
if theDestroyedUnit.type ~= 'Weapon' then local targetList = { {type='Aircraft', dbid=3563, points=100, name='aircraft', destroyedString='shot down'},--F-5E Tiger II [DACT] {type='Facility', dbid=1070, points=25, name='AAA battery', destroyedString='destroyed'},--AAA Bty (37mm T65 Twin x 4) {type='Facility', dbid=1071, points=25, name='AAA battery', destroyedString='destroyed'},--AAA Bty (57mm M1950 x 4 + Fire Can FC) {type='Facility', dbid=256, points=0, name='aircraft revetment', destroyedString=nil},--A/C Revetment (1x Large Aircraft) {type='Facility', dbid=311, points=100, name='SAM battalion', destroyedString='destroyed'},--SAM Bn (SA-3b Goa [S-125M Neva-M]) {type='Facility', dbid=975, points=50, name='SAM platoon', destroyedString='destroyed'},--SAM Plt (SA-9b Gaskin [9K31 Strela-1]) }
local matchData = {}
for k,v in ipairs (targetList) do if v.dbid == theDestroyedUnit.dbid and v.type == theDestroyedUnit.type then matchData = v end end
if matchData.dbid == nil then BugMessage('OPFOR_UnitDestroyed', 'No dbid match found for destroyed unit') if DebugModeIsOn() then ScenEdit_SpecialMessage('playerside','Could not find match for destroyed unit '..theDestroyedUnit.name..', dbid '..theDestroyedUnit.dbid) end else ChangeScore('Students',matchData.points,'An OPFOR '..matchData.name.. ' was '..matchData.destroyedString..'.') end end

local theDestroyedUnit = ScenEdit_UnitX()
if theDestroyedUnit.type ~= 'Weapon' then local targetList = { {type='Aircraft', dbid=2830, points=-200, name='aircraft', destroyedString='shot down'},--F-4E Phantom II }
local matchData = {}
for k,v in ipairs (targetList) do if v.dbid == theDestroyedUnit.dbid and v.type == theDestroyedUnit.type then matchData = v end end
if matchData.dbid == nil then BugMessage('Students_UnitDestroyed', 'No dbid match found for destroyed unit') if DebugModeIsOn() then ScenEdit_SpecialMessage('playerside','Could not find match for destroyed unit '..theDestroyedUnit.name..', dbid '..theDestroyedUnit.dbid) end else ChangeScore('Students',matchData.points,'A student '..matchData.name.. ' was '..matchData.destroyedString..'.')
local sideUnits = VP_GetSide({side='Students'}).units local aircraftRemaining = 0 for k,v in ipairs (sideUnits) do local unit = ScenEdit_GetUnit({guid=v.guid}) if unit.type == 'Aircraft' then aircraftRemaining = aircraftRemaining + 1 end end if aircraftRemaining == 0 then ChangeScore('Students',-2500,'All aircraft were lost.') ScenEdit_EndScenario() end end end
